description:
The 4th Edition (2010) of the textbook 'Human Molecular Genetics' by Tom Strachan &amp; Andrew Read, published by 'Garland Science Publishing'.

ISBN: 978-0815341499

Scanned in 200 DPI color and OCRed in PDF format.

Includes contents and all chapters. 

The 'index' and 'glossary' sections, as well as the 'references' at the end of each chapters are missing, because they are useless.

Enjoy.

